import React from 'react';
import { Button } from "antd";
import { PlusCircleOutlined } from "@ant-design/icons";

 const submitButton = ({onClick, color}) =>{
     return (
        <Button
        style={{ marginLeft: 10 }}
        type="primary"
        disabled={!color}
        onClick={onClick}
      >
        <PlusCircleOutlined />
      </Button>
     )
 }
